function RecipeView({ name, cuisine, photo, ingredients,preperation }){

    return (
        <tr>
            <td>
                {name}
            </td>
            <td>
                {cuisine}
            </td>
            <td>
                {photo}
            </td>
            <td>
                {ingredients}
            </td>
            <td>
                {preperation}
            </td>
        </tr>
    )

}

export default RecipeView;
